import * as React from 'react';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';

const jobs = [
  { id: 1, title: '05 Developers (ReactJS, NodeJS)', skills: 'Nihil tenetur quia ipsum vitae excepturi veniam. Excepteur quam reiciendis quis. In adipisci quibusdam.' },
  { id: 2, title: 'Full Stack Software Engineer', skills: 'Corporis quam corrupti dolorem et temporibus. Ut quisquam saepe cumque molestias quis cum consequatur et minus.' },
  { id: 3, title: 'Full-Stack Engineer - Open to U.S. Remote', skills: 'Numquam voluptatem iste. Facere rerum aperiam et reiciendis. Blanditiis et unde.' },
  { id: 4, title: 'Full Stack Software Engineer', skills: 'Incidunt dolorem tempore nihil. Quod praesentium architecto ut minus atque molestiae voluptas doloribus.' },
  { id: 5, title: 'React Native Dev (JavaScript, ReactJS)', skills: 'Ut nobis libero libero magni. Ut qui aut iure qui rerum hic. Et sed nostrum porro quia vel nihil dolores nisi.' },
];

function JobBox({ job }) {
  return (
    <Box
      height={200}
      width={300}
      display="flex"
      flexDirection="column"
      justifyContent="center"
      alignItems="center"
      p={2}
      borderRadius={3}
      sx={{ border: '2px solid grey', textAlign: 'center' }}
    >
      <Typography variant="h6" gutterBottom>
        {job.title}
      </Typography>
      <Box>
        {job.skills.split('\n').map((skill, index) => (
          <Typography key={index}>
            {skill}
          </Typography>
        ))}
      </Box>
    </Box>
  );
}

export default function CenteredGrid() {
  return (
    <Grid
      container
      spacing={3}
      justifyContent="center"
      alignItems="center"
      style={{ minHeight: '100vh' }}
    >
      {jobs.map((job) => (
        <Grid key={job.id} item xs={12} sm={6} md={4} lg={3} display="flex" justifyContent="center">
          <JobBox job={job} />
        </Grid>
      ))}
    </Grid>
  );
}
